import React, { useState } from 'react';


const Event=()=>{

    let [curValue,update]= useState();

    const ChangeBG=()=>{
        update(curValue + 1);
    }
    return(
        <>
        <h1>{curValue}</h1>
        <button onClick={ChangeBG} style={{ padding: '0.5rem', color: 'white', backgroundColor: 'purple', outline: 'none', borderRadius: '10px', border: '0px', margin: '-15px 5px 16px 0' }}>Change</button>
        </>
    )
}

export default Event;
